(function($) {
  'use strict';
  $(function() {
    $('[data-toggle="offcanvas"]').on("click", function() {
      $('.sidebar-offcanvas').toggleClass('active')
    });
  });
})(jQuery);
(function($) {
  'use strict';
  $(function() {
    var sidebar = $('.sidebar');

    //Add active class to nav-link based on url dynamically
    //Active class can be hard coded directly in html file also as required
    var current = location.pathname.split("/").slice(-1)[0].replace(/^\/|\/$/g, '');
    $('.nav li a', sidebar).each(function() {
      var $this = $(this);
      if (current === "") {
        //for root url
        if ($this.attr('href').indexOf("index.html") !== -1) {
          $(this).parents('.nav-item').last().addClass('active');
          if ($(this).parents('.sub-menu').length) {
            $(this).closest('.collapse').addClass('show');
            $(this).addClass('active');
          }
        }
      } else {
        //for other url
        if ($this.attr('href').indexOf(current) !== -1) {
          $(this).parents('.nav-item').last().addClass('active');
          if ($(this).parents('.sub-menu').length) {
            $(this).closest('.collapse').addClass('show');
            $(this).addClass('active');
          }
        }
      }
    })

    //Close other submenu in sidebar on opening any

    sidebar.on('show.bs.collapse', '.collapse', function() {
      sidebar.find('.collapse.show').collapse('hide');
    });


    //Change sidebar and content-wrapper height
    applyStyles();

    function applyStyles() {
      //Applying perfect scrollbar
      if ($('.scroll-container').length) {
        const ScrollContainer = new PerfectScrollbar('.scroll-container');
      }
    }

    //checkbox and radios
    $(".form-check label,.form-radio label").append('<i class="input-helper"></i>');


    $(".purchace-popup .popup-dismiss").on("click",function(){
      $(".purchace-popup").slideToggle();
    });
  });
})(jQuery);

Dropzone.options.myDropzone= {
      autoDiscover:false,
    url: 'save',
    method: 'POST',
    autoProcessQueue: false,
    uploadMultiple: true,
    parallelUploads: 5,
    maxFiles: 5,
    maxFilesize: 1,
    acceptedFiles: 'image/*',
    addRemoveLinks: true,
    removeAllFiles: true,
    init: function() {
        dzClosure = this; // Makes sure that 'this' is understood inside the functions below.
        // for Dropzone to process the queue (instead of default form behavior):
        document.getElementById("submit-all").addEventListener("click", function(e) {
            // Make sure that the form isn't actually being sent.

            e.preventDefault();
            e.stopPropagation();
            dzClosure.processQueue();
          

        });
              this.on("maxfilesexceeded", function(file) {
       alert("You can only add three photos.");
              this.removeFile(file);
      });
        this.on("addedfile", function(file) {
           var a= document.getElementsByClassName('dz-message')
           var b=a[0].firstChild
           b.style.display="none";


      });
     this.on("removedfile", function(file) {

            if (this.files.length==0) {
           var a= document.getElementsByClassName('dz-message')
           var b=a[0].firstChild
           b.style.display="block";
            }



      });
        this.on("sendingmultiple", function(data, xhr, formData) {
              var data = $('#my').serializeArray();
            $.each(data, function(key, el) {
                formData.append(el.name, el.value);
            });
        });

        this.on("successmultiple", function(data) {

            window.location='/admin'
        });
        this.on("error", function(files, error, xhr) {


                $(".pp").remove();
                $('#errors br').remove();

                        e=error['errors']
            this.removeFile(files);
        var a= document.getElementsByClassName('dz-message')
           var b=a[0].firstChild
           b.style.display="block";


            a=document.getElementById("errors")
            a.className += 'alert alert-danger';
             $("#errors").append(`<span class="pp">-Need to Add Images again<span><br>`)
            for (x in error['errors']) {
               $("#errors").append('<span class="pp">-'+error['errors'][x]+'</span>'+'<br>');
                
            }
   
          
        


        });



    }
}

